import React from 'react'
import {
  MDBBtn,
  MDBContainer,
  MDBIcon,
  MDBTable,
  MDBTableBody,
  MDBTableHead,
} from "mdb-react-ui-kit";
function ShowResult() {
    const skills = ['Aptitude', 'Reasoning', 'Technical'];
    const scores = [Math.floor(Math.random() * 21), Math.floor(Math.random() * 21), Math.floor(Math.random() * 21)];
    const yourScore = [90, 85, 95];
  
    return (
        <div align ="center">
      <MDBtable responsive
        striped
        hover
        className="table table-bordered border-black">
        <MDBTableHead>
          <tr>
            <th>Skill</th>
            <th>Score</th>
          </tr>
          </MDBTableHead>
        <MDBTableBody>
    {skills.map((skill, index) => (
      <tr key={skill}>
        <td style={{ textAlign: "center" }}>{skill}</td>
        <td>{index === 0 ? scores[index] : yourScore[index - 1]}</td>
        <td></td>
      </tr>
    ))}
  </MDBTableBody>
      </MDBtable>
      </div>
    );
  }

export default ShowResult
